#include <iostream>
#include <stack>

using namespace std;

class Solution
{
public:
    bool find132pattern(vector<int> &nums)
    {
        int min{INT_MIN};
        stack<int> stk;

        for (int i = nums.size() - 1; i >= 0; --i)
        {
            if (nums[i] < min)
            {
                return true;
            }
            while (!stk.empty() && stk.top() < nums[i])
            {
                min = stk.top();
                stk.pop();
            }
            stk.push(nums[i]);
        }

        return false;
    }
    
    bool find132patternNaive(vector<int> &nums)
    {
        // O(n^3)
        
        // Initialize three pointers
        vector<int>::iterator fp{nums.begin()}, mp, bp;
        
        while (fp < nums.end() - 2)
        {
            mp = fp + 1;
            if (*mp != *fp) // If mp == fp, then we can move fp forward one without checking mp.
            {
                while (mp < nums.end() - 1)
                {
                    if (*mp > *fp + 1) // Only check bp if mp is valid.
                    {
                        bp = mp + 1;
                        if (*bp != *mp) // If bp == mp, then can move mp forward one without checking bp.
                        {
                            while (bp < nums.end())
                            {
                                if (*bp < *mp && *fp < *bp)
                                {
                                    return true;
                                }
                                ++bp;
                            }
                        }
                    }
                    ++mp;
                }
            }
            // Move the pointers according to fp each iteration.
            ++fp;
        }
        
        // Return false if we scan the whole array and come up with nothing.
        return false;
    }
};

